"    window.app = {};

    window.app.requests = {};
    window.app.responses = {};

    window.app.state = {};
    window.app.subscribers = {};

    window.app.error = e => `{"id":"${e.id}","type":"error","func":"${e.func}","data":{"code":"${e.code}"}}`;

    window.app.request = (type, func, data) => new Promise((resolve, reject) => {
        const id = Math.random().toString(36);

        try {
            const request = { id, type, func, data: data ? data : "null" };
            window.app.requests[id] = request;

            const string = JSON.stringify(request);
            window.app.responses[id] = { resolve, reject };
            window.webkit.messageHandlers.default.postMessage(string);
        } catch (e) {
            const error = window.app.error({ id, func, code: 'invalidRequest' });
            window.webkit.messageHandlers.default.postMessage(error);
            reject({ code: 'invalidRequest', func, invalid: null });
        }
    });

    window.app.resolve = (id, data) => {
        if (!window.app.responses[id]) {
            const request = window.app.requests[id];
            const func = request ? request.func : 'error';
            const error = window.app.error({ id, func, code: 'requestUnavailable' });
            window.webkit.messageHandlers.default.postMessage(error);
            return;
        }

        window.app.responses[id].resolve(data);
        delete window.app.responses[id];
    };

    window.app.reject = (id, data) => {
        if (!window.app.responses[id]) {
            const request = window.app.requests[id];
            const func = request ? request.func : 'error';
            const error = window.app.error({ id, func, code: 'requestUnavailable' });
            window.webkit.messageHandlers.default.postMessage(error);
            return;
        }

        window.app.responses[id].reject(data);
        delete window.app.responses[id];
    };

    window.app.subscribe = func => {
        const id = Math.random().toString(36);
        window.app.subscribers[id] = func;
        return id;
    };

    window.app.unsubscribe = id => {
        if (window.app.subscribers[id]) delete window.app.subscribers[id];
    };

    window.app.update = state => {
        Object.values(window.app.subscribers).forEach(subscriber => {
            try {
                subscriber(state);
            } catch (e) {}
        });
    };

    window.app.init = async () => {
        try {
            await window.app.request('internal', 'initial');
        } catch (e) {}
    };

    window.app.log = message => {
        const run = async () => {
            try {
                await window.app.request('internal', 'log', { message });
            } catch (e) {}
        };

        run();
    };

    window.app.init();"
